    t[364] = "When a new service tunnel is created, or a service is run for the first time (e.g. the default jetty webserver, plugins), a private encryption key is created which essentially controls the ownership of address. This is usually named <code>&hellip;privKey.dat</code>, or <code>eepPriv.dat</code>, though it's a good idea to change the name to indicate the service it belongs to and then respecify it in the Tunnel Manager server settings. This .dat file should be backed up safely; lose it and you will lose ownership and control of your hostname!";
    t[365] = "Kui luuakse uus teenuserada v\u00f5i teenus k\u00e4ivitatakse esimest korda (nt vaike-jetty-veebiserver, pluginatega), luuakse privaatne kr\u00fcpteerimisv\u00f5ti, mis kontrollib olemuslikult aadressi omanikku. See on reeglina nimetatud <code>&hellip;privKey.dat</code> v\u00f5i <code>eepPriv.dat</code>, kuigi on hea m\u00f5te muuta nime, et see n\u00e4itaks teenust, millele ta kuulub, ja seej\u00e4rel m\u00e4\u00e4rake see uuesti tunnelihalduri serveriseadistustes. See .dat fail peaks olema turvaliselt varundatud. Kui kaotate selle, kaotate domeeni omandi\u00f5iguse ja kontrolli!";
    t[368] = "This setting allows configuration of the maximum number of files per torrent I2PSnark will permit, when downloading or creating a torrent. Note that substantially increasing this value from the default of 2000 files may require additional configuration on the host system to increase the maximum number of open files the operating system will permit (e.g. <code>ulimit -n</code> on Linux). To change, add to I2PSnark's configuration file <code>i2psnark.config</code>. [Restart of I2PSnark or router required]";
    t[369] = "Selle seadistuse abil saab konfigureerida suurimat lubatud failide arvu torrenti kohta, mida I2PSnark v\u00f5imaldab, kui torrenti alla laaditakse v\u00f5i luuakse. Pange t\u00e4hele, et selle v\u00e4\u00e4rtuse oluline suurendamine vaikimisi 2000 failist v\u00f5ib n\u00f5uda t\u00e4iendavat konfiguratsiooni hostis\u00fcsteemis, et suurendada t\u00f6\u00f6\u00fclesannete maksimaalset arvu, mida operatsioonis\u00fcsteem lubab (nt Linuxi puhul <code>ulimit -n</code>). Muutmiseks lisage see I2PSnarki konfiguratsioonifaili <code>i2psnark.config</code>. [I2PSnarki v\u00f5i marsruuteri taask\u00e4ivitamine on vajalik]";
