    t[554] = "Choose a name for your website (<i>hostname</i>.i2p), using lower-case. To verify that the hostname is available, check <a href=http://notbob.i2p/ target=_blank>notbob.i2p</a> or <a href=http://reg.i2p target=_blank>reg.i2p</a> before you decide. Enter the new name for your website on the <a href='/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a> where it says <i>Website name</i>, replacing the default <i>mysite.i2p</i> placeholder. If you want your website to be available when I2P starts, enable <i>Auto Start</i> and then click <i>Save</i>.";
    t[555] = "Valige oma veebisaidi jaoks nimi (<i>hostinimetus</i>.i2p), kasutades v\u00e4ikeseid t\u00e4hti. Et veenduda, et hostinimi on saadaval, kontrollige seda <a href=http://notbob.i2p/ target=_blank>notbob.i2p</a> v\u00f5i <a href=http://reg.i2p target=_blank>reg.i2p</a> enne otsustamist. Sisestage oma veebisaidi uus nimi <a href='/i2ptunnel/edit?tunnel=3'>Tunnelihalduri seadistamise lehel</a>, kus on \u00f6eldud <i>Veebinsaidi nimi</i>, asendades vaikimisi v\u00e4\u00e4rtuse <i>mysite.i2p</i>. Kui soovite, et teie veebisait oleks saadaval p\u00e4rast I2P k\u00e4ivitamist, lubage valida <i>Automaatne k\u00e4ivitamine</i> ja kl\u00f5psake seej\u00e4rel <i>Salvesta</i>.";
