    t[621] = "Kuigi I2P t\u00f6\u00f6tab selles olukorras, oleks v\u00e4ga abiks, juhul kui sul on nii palju ribalaiust teistele jagada, kui p\u00fc\u00fcaksid avada ka pordi oma tulem\u00fc\u00fcris.";
    t[622] = "A command-line application supplied with I2P that is used to request URL resources, similar to <a href=https://www.gnu.org/software/wget/ class='sitelink external' target=_blank rel=noreferrer>wget</a> or <a href=https://curl.haxx.se/ class='sitelink external' target=_blank rel=noreferrer>curl</a>. Eepget is also used internally by the router, for example to reseed from remote hosts. By default, eepget uses the HTTP proxy on <code>127.0.0.1:4444</code>.";
    t[623] = "I2P-ga kaasas olev k\u00e4skejoone rakendus, mida kasutatakse URL-i ressursside taotlemiseks, sarnaselt<a href=https://www.gnu.org/software/wget/ class='sitelink external' target=_blank rel=noreferrer>wget</a> v\u00f5i <a href=https://curl.haxx.se/ class='sitelink external' target=_blank rel=noreferrer>curl</a> ga. Eepgetit kasutatakse ka sisemiselt ruuteris, n\u00e4iteks lokaalse ruuteri korrigeerimiseks kaugemas hostis. Vaikimisi kasutab eepget HTTP proksi URL-is <code>127.0.0.1:4444</code>.";
