    t[723] = "Javadocs";
    t[724] = "An eepsite is a website that is hosted anonymously on the I2P network - you can access it by configuring your web browser to use I2P's HTTP proxy (see above) and browsing to the <code>.i2p</code> suffixed website (e.g. <a href=http://i2p-projekt.i2p/ target=_blank rel=noreferrer class=sitelink>http://i2p-projekt.i2p</a>). Also ensure your browser is configured to resolve DNS remotely when using the proxy to avoid DNS leaks.";
    t[725] = "Eepsite on veebisait, mis on anon\u00fc\u00fcmselt majutatud I2P v\u00f5rgus \u2013 sellele p\u00e4\u00e4seb juurde, konfigureerides veebibrauseri I2P HTTP proksi kasutamiseks (vaata \u00fclespoole) ja sirvides lehek\u00fcljele, mis on l\u00f5petatud <code>.i2p</code> nimega (nt <a href=http://i2p-projekt.i2p/ target=_blank rel=noreferrer class=sitelink>http://i2p-projekt.i2p</a>). Veenduge ka, et teie veebibrauser on seadistatud resolveti kaugm\u00e4\u00e4ratlusteks, kui seda kasutatakse proksi kasutamisel andmep\u00e4ringu lekkimise v\u00e4ltimiseks.";
