    t[836] = "The first number is the number of peers your router has sent or received a message from in the last few minutes. This may range from 8-10 to several hundred, depending on your total bandwidth, shared bandwidth, and locally-generated traffic. The second number is the number of peers seen in the last hour or so. Do not be concerned if these numbers vary widely. <a href='/configstats#router.activePeers'>[Enable graphing]</a>.";
    t[837] = "Esimene number on ruuteri l\u00e4hiajaloos s\u00f5numeid saatnud v\u00f5i vastu v\u00f5tnud peeride arv. See v\u00f5ib varieeruda 8-10-st saja-ni, s\u00f5ltuvalt sinu \u00fcldisest ribalaiusest, jagatud ribalaiusest ja projekti koostatud liiklusest. Teine number on viimatine n\u00e4htud peeride arv umbes tunni jooksul. \u00c4ra muretse, kui need numbrid oluliselt varieeruvad. <a href='/configstats#router.activePeers'>[Luba graafiku kuvamine]</a>.";
