    t[2210] = "I2P selects a random port between 9000 and 31000 to communicate with other routers when the program is run for the first time, or when your external IP address changes when running in <a href=/confignet#ipchange>Laptop Mode</a>. The <a href=/confignet#udpconfig>selected port</a> is shown on the <a href=/confignet>Network Configuration page</a>.";
    t[2211] = "I2P valib suvalise pordi vahemikus 9000 kuni 31000 suhtlemiseks teiste ruuteritega, kui programm k\u00e4ivitatakse esimest korda v\u00f5i kui v\u00e4limine IP-aadress muutub, kui t\u00f6\u00f6tab re\u017eiimis <a href=/confignet#ipchange>lauaarvuti re\u017eiimis</a>. <a href=/confignet#udpconfig>Valitud port</a> kuvatakse <a href=/confignet>v\u00f5rgu konfiguratsiooni lehel</a>.";
