    t[2246] = "A gentle introduction to I2P";
    t[2247] = "I2P \u00f5rn sissejuhatus";
    t[2250] = "How long jobs are waiting before execution. The job queue is listed on the <a href='/jobs'>Jobs page</a>. Unfortunately, there are several other job queues in the router that may be congested, and their status is not available in the router console. The job lag should generally be zero. If it is consistently higher than 500ms, your computer is very slow, your network is experiencing connectivity issues, or the router has serious problems. <a href='/configstats#jobQueue.jobLag'>[Enable graphing]</a>.";
    t[2251] = "Kui kaua t\u00f6\u00f6d ootavad enne t\u00e4itmist. T\u00f6\u00f6j\u00e4rjekord on loetletud lehel <a href='/jobs'>T\u00f6\u00f6d</a>. Kahjuks on ruuteris mitu muud t\u00f6\u00f6j\u00e4rjekorda, mis v\u00f5ivad olla ummistunud, ja nende olek pole ruuteri konsoolis saadaval. T\u00f6\u00f6 viivitus peaks \u00fcldiselt olema null. Kui see on pidevalt suurem kui 500 ms, on teie arvuti v\u00e4ga aeglane, teie v\u00f5rgus esineb \u00fchenduvusprobleeme v\u00f5i ruuteril on t\u00f5siseid probleeme. <a href='/configstats#jobQueue.jobLag'>[Luba graafik]</a>.";
    t[2252] = "Configure I2P Updates";
    t[2253] = "I2P-v\u00e4rskenduste konfigureerimine";
    t[2254] = "Before you tell the world about your new website, you should add some content. Go to the server's root directory <a href=#rootdir>listed above</a> and replace the <i>index.html</i> redirect page with your own content. If you need a template for a basic site, feel free to adapt <a href=http://127.0.0.1:7658/help/pagetemplate.html>this page</a>. If you're returned to this page after editing the content, try clearing your browser's web cache.";
    t[2255] = "Enne oma uue veebisaidi maailmale teatamist peaksite lisama m\u00f5nda sisu. Minge serveri juurkataloogi, mis on <a href=#rootdir>\u00fclal loetletud</a>, ja asendage oma sisuga <i>index.html</i> \u00fcmbersuunamisleht. Kui vajate p\u00f5hilehe jaoks malli, v\u00f5ite sellele lehele vabalt l\u00e4heneda: <a href=http://127.0.0.1:7658/help/pagetemplate.html>this page</a>. Kui p\u00e4rast sisu redigeerimist j\u00f5uate tagasi sellele lehele, proovige veebipuhvrist vahem\u00e4lu kustutada.";
