    t[2365] = "M\u00f5ned marsruuteri \u00fclekoormuse p\u00f5hilised n\u00e4itajad:";
    t[2370] = "Glossary";
    t[2371] = "S\u00f5nastik";
    t[2376] = "To obtain your own hostname, I2P domain registrars such as <a href=http://stats.i2p/i2p/addkey.html target=_blank rel=noreferrer class=sitelink>stats.i2p</a> or <a href=http://reg.i2p/ target=_blank rel=noreferrer class=sitelink>reg.i2p</a> provide registration services that allow you to register and manage an .i2p hostname or sub-domain which will then be propagated across the network. Some registration sites will require the <i>B64 destination address</i> for the tunnel/service you wish to associate with a hostname, which you should copy from the <i>Local destination</i> section on the <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>.";
    t[2377] = "Omaenda hostinime saamiseks v\u00f5imaldavad I2P domeeni registreerijad nagu <a href=http://stats.i2p/i2p/addkey.html target=_blank rel=noreferrer class=sitelink>stats.i2p</a> v\u00f5i <a href=http://reg.i2p/ target=_blank rel=noreferrer class=sitelink>reg.i2p</a> registreerimisteenused, mis v\u00f5imaldavad registreerida ja hallata .i2p hostinime v\u00f5i alamdomeeni, mis seej\u00e4rel levib v\u00f5rgu kaudu. M\u00f5ned registreerimissaidid n\u00f5uavad hostinimega seotud tunneli/teenuse jaoks <i>B64 sihtkoha aadressi</i>, mille saate kopeerida <i>Kohalik sihtkoht</i> sektsioonist <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Tunnelihalduri konfiguratsioonilehelt</a>.";
