    t[2471] = "Partner-ruuterite k\u00e4sitsi h\u00e4\u00e4lestus";
    t[2482] = "This indicates the amount of RAM I2P is using, and the total amount available, allocated by Java. If the usage is consistently high relative to the available RAM, this may indicate that you need to increase the ram allocated to the JVM. You can allocate more RAM by editing your <code>wrapper.config</code> file which is normally located in the I2P application directory. You will need to edit the <code>wrapper.java.maxmemory</code> parameter, which by default is set to 256(MB) for I2P, or 384 for I2P+. Note: if the memory bar is enabled, the memory entry in the router info section will be suppressed.";
    t[2483] = "See n\u00e4itab, kui palju RAM-i I2P kasutab ning kui palju on kokku saadaval, mille on Java eraldanud. Kui kasutus on pidevalt suhteliselt suur saadaoleva RAM-i suhtes, v\u00f5ib see viidata sellele, et peate JVM-ile eraldatud RAM-i suurendama. Saate rohkem RAM-i eraldada, redigeerides oma I2P rakenduskataloogis asuvat <code>wrapper.config</code> faili. Peate muutma vaikev\u00e4\u00e4rtusega <code>wrapper.java.maxmemory</code> parameetrit, mis on I2P puhul vaikem\u00e4\u00e4ratud 256 (MB) v\u00f5i I2P+ puhul 384. M\u00e4rkus: kui m\u00e4lu riba on lubatud, j\u00e4\u00e4b m\u00e4lu sisestus marsruuteri teabe jaotisesse peitu.";
