    t[2536] = "Under <i>Configure Proxy Access to Internet</i> select the <i>Manual proxy configuration</i> option.";
    t[2537] = "Valige <i>Interneti puhverserveri juurdep\u00e4\u00e4su konfigureerimine</i> alajaotises <i>Manuaalne puhverserveri konfiguratsioon</i> valik.";
    t[2538] = "To serve your own static content, you only need to edit or replace the files in the webserver's root directory, and the site will be available on the I2P network after you've followed the instructions below. Additionally, cgi and python scripts can be run from the <code>cgi-bin</code> directory immediately above <code>docroot</code> if you have <a href=https://www.perl.org/about.html target=_blank rel=noreferrer class='sitelink external'>perl</a> and <a href=https://www.python.org/ target=_blank rel=noreferrer class='sitelink external'>python</a> installed.";
    t[2539] = "Oma staatilise sisu teenindamiseks piisab, kui redigeerite v\u00f5i asendate ainult failid veebiserveri juurkataloogis ning sait on p\u00e4rast allpool olevate juhiste j\u00e4rgimist saadaval I2P v\u00f5rgus. Lisaks saab k\u00e4ivitada cgi ja pythoni skripte kataloogist <code>cgi-bin</code>, mis asub kohe <code>docroot</code>'ist eespool, kui teil on installitud <a href=https://www.perl.org/about.html target=_blank rel=noreferrer class='sitelink external'>perl</a> ja <a href=https://www.python.org/ target=_blank rel=noreferrer class='sitelink external'>python</a>.";
