    t[2616] = "If you know and trust somebody that runs I2P, ask them to send you a reseed file generated using this page in their router console. Then, select the <i>Reseed from file</i> option on the {0} using the file you received.";
    t[2617] = "Kui sa tead ja usaldad kedagi, kes t\u00f6\u00f6tab I2P-s, palu neil saata sulle uuestis\u00f6\u00f6tmise fail, mida nad on genereerinud sellel lehel oma ruuteri konsoolis. Seej\u00e4rel vali {0}-s valik <i>Uuestis\u00f6\u00f6t failist</i> ja kasuta saadud faili.";
