    t[2696] = "This setting (in seconds) allows you to override the delay between runs of the Peer Exploration Job which attempts to locate new peers to add to the NetDb. The job will run every 80 seconds by default, or if the router is experiencing job or message lag, every 3 minutes. If the size of the NetDb reaches 4000 peers, the pause will increase to 15 minutes. You may wish to increase the delay if your NetDb is well-populated (over 2000 peers), or if you wish to reduce overall bandwidth usage. Note: For Floodfill routers, this job does not run.";
    t[2697] = "See s\u00e4ttimine (sekundites) v\u00f5imaldab teil \u00fclekirjutada viivitust Peer Exploration Job t\u00f6\u00f6tuste vahel, mis \u00fcritab leida uusi eakaaslasi NetDb-sse lisamiseks. Vaikimisi t\u00f6\u00f6tab t\u00f6\u00f6 iga 80 sekundi j\u00e4rel v\u00f5i kui v\u00f5truja kogeb t\u00f6\u00f6 v\u00f5i s\u00f5numite viivitust, siis iga 3 minuti j\u00e4rel. Kui NetDb suurus j\u00f5uab 4000 eakaaslasele, siis paus suureneb 15 minutini. Soovitav on suurendada viivitust, kui teie NetDb-s on palju eakaaslasi (rohkem kui 2000 eakaaslast) v\u00f5i kui soovite v\u00e4hendada \u00fcldist ribalaiuse tarbimist. M\u00e4rkus: Floodfill-v\u00f5rutajate jaoks see t\u00f6\u00f6 ei k\u00e4ivitu.";
    t[2698] = "Current";
    t[2699] = "praegune";
    t[2720] = "A website hosted on the I2P network. By default, a <a href=https://www.eclipse.org/jetty/about.html class='sitelink external' target=_blank rel=noreferrer>Jetty webserver</a> is configured and running on <a href=http://127.0.0.1:7658/ target=_blank rel=noreferrer>http://127.0.0.1:7658/</a>.";
    t[2721] = "Veebisait, mille majutab I2P v\u00f5rk. Vaikimisi on seadistatud ja k\u00e4ivitatud <a href=https://www.eclipse.org/jetty/about.html class='sitelink external' target=_blank rel=noreferrer>Jetty veebiserver</a> <a href=http://127.0.0.1:7658/ target=_blank rel=noreferrer>http://127.0.0.1:7658/</a>.";
    t[2722] = "Can be disabled or changed in the <a href=/i2ptunnelmgr>Tunnel Manager</a>. Can also be configured to bind to a specific interface or all interfaces.";
    t[2723] = "V\u00f5ib olla keelatud v\u00f5i muudetud <a href=/i2ptunnelmgr>Tunnelihalduris</a>. V\u00f5ib olla seadistatud kasutama konkreetset liidest v\u00f5i k\u00f5iki liideseid.";
    t[2728] = "I2P+ Service now enabled on system start";
    t[2729] = "I2P-teenus on n\u00fc\u00fcd s\u00fcsteemi k\u00e4ivitamisel lubatud";
