    t[2752] = "Same IP as us";
    t[2753] = "Sama IP mis meil";
    t[2754] = "You may create a new router family here. Once you have created the family, you may export the family key file and share with other routers in your nominated family.";
    t[2755] = "V\u00f5ite siin luua uue ruuteri pere. Kui olete pere loonud, v\u00f5ite eksportida perekonna v\u00f5tmefaili ja jagada oma nimetatud pere teiste ruuteriga.";
    t[2756] = "Tunnels peer has agreed to participate in";
    t[2757] = "Tunneli eakaaslane on n\u00f5ustunud osalema";
    t[2758] = "Advanced Lookup";
    t[2759] = "T\u00e4psem otsing";
    t[2766] = "In order to access websites hosted on I2P, and optionally use the default outproxy to connect to websites on clearnet, you will need to configure your browser to use the I2P HTTP proxy, by default running on <code>127.0.0.1 port 4444</code>. Most browsers offer an option to configure your proxy; in this mini-tutorial we'll focus on Firefox.";
    t[2767] = "I2P-s hostitud veebisaitidele juurdep\u00e4\u00e4suks ja valikuliselt veebisaitidele selgev\u00f5rgus \u00fchendumiseks kasutades vaikimisi v\u00e4ljaminevat puhverserverit, peate konfigureerima oma brauseri kasutama I2P HTTP puhverserverit, mis t\u00f6\u00f6tab vaikimisi aadressil <code>127.0.0.1 port 4444</code>. Enamik brausereid pakub puhverserveri konfigureerimise v\u00f5imalust; selles mini\u00f5petuses keskendume Firefoxi kasutamisele.";
    t[2776] = "Close to us";
    t[2777] = "Meile l\u00e4hedal";
    t[2790] = "I2P+ Router Sitemap";
    t[2791] = "I2P ruuteri saidikaart";
    t[2794] = "Downloaded plugin version {0} is not newer than installed plugin";
    t[2795] = "Alla laetud plugina versioon {0} ei ole suurem paigaldatud pluginast";
    t[2796] = "Streaming radio service";
    t[2797] = "Voogesitusraadioteenus";
    t[2798] = "I2P+ functions best when you can accurately reflect the speed of your network connection in the <a href=/config>bandwidth configuration section</a>. By default I2P+ is configured with some fairly conservative values that will not suit many use cases, so please take time to review these settings and correct where necessary. The more bandwidth you allocate, <i>specifically</i> upstream bandwidth, the more you will benefit from the network.";
    t[2799] = "I2P+ toimib k\u00f5ige paremini, kui saate t\u00e4pselt kajastada oma v\u00f5rgu\u00fchenduse kiirust <a href=/config>ribalaiuse konfiguratsiooni l\u00f5igus</a>. I2P+ on vaikimisi seadistatud m\u00f5ningate \u00fcsna konservatiivsete v\u00e4\u00e4rtustega, mis ei sobi paljudele kasutusjuhtudele, seega v\u00f5tke palun aega nende seadete \u00fclevaatamiseks ja vajadusel parandamiseks. Mida rohkem ribalaiust eraldate, <i>konkreetselt</i> \u00fclesvoolu ribalaius, seda suuremat kasu saate v\u00f5rgust.";
    t[2810] = "Transit by Peer";
    t[2811] = "Peeri \u00fchistransport";
