    t[2813] = "Peidetud re\u017eiim";
    t[2814] = "Plugin requires Jetty version {0} or lower";
    t[2815] = "Plugin n\u00f5uab Jetty versiooni {0} v\u00f5i madalamat";
    t[2822] = "The proxy may be remotely hosted or a service running on your computer (localhost/127.0.0.1).";
    t[2823] = "Proxy v\u00f5ib olla kaugelt majutatud v\u00f5i teenus, mis t\u00f6\u00f6tab teie arvutis (localhost/127.0.0.1).";
    t[2824] = "Events in peak period";
