    t[2838] = "Router Console &amp; WebApps Display Language";
    t[2839] = "Ruuteri konsooli ja veebirakenduste kuvamiskeel";
    t[2844] = "What to do in the event I2P+ isn't working";
    t[2845] = "Mida teha, kui I2P+ ei t\u00f6\u00f6ta";
    t[2856] = "ANONYMITY WARNING - Settings include 1-hop tunnels.";
    t[2857] = "ANON\u00dc\u00dcMSUSE HOIATUS - H\u00e4\u00e4lestus lubab 1-sammuseid tunneleid.";
    t[2858] = "I2P IRC Network";
    t[2859] = "I2P IRC-v\u00f5rk";
    t[2864] = "pixels wide";
    t[2865] = "pikslit lai";
    t[2882] = "The I2P Network Protocol (I2NP) manages the routing and mixing of messages between routers, in addition to the transport selection (where more than one is supported) when communicating with a peer. For more information, see the <a href=https://geti2p.net/en/docs/protocol/i2np class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[2883] = "I2P v\u00f5rguprotokoll (I2NP) juhib teadete marsruutimist ja segamist ruutrite vahel, lisaks transpordi valimine (kui rohkem kui \u00fcks on toetatud) suheldes eakaaslasega. Rohkem teavet leiate <a href=https://geti2p.net/en/docs/protocol/i2np class='sitelink external' target=_blank rel=noreferrer>vebdokumentatsioonist</a>.";
    t[2884] = "Expired {0} ago";
    t[2885] = "Aegus {0} eest";
    t[2892] = "Your router's status on accepting or rejecting requests from other routers to build a participating tunnel through your router. Your router may accept all requests, accept or reject a percentage of requests, or reject all requests for a number of reasons, to control the bandwidth and CPU demands and maintain capacity for local clients. <b>Note";
    t[2893] = "Teie marsruuteri staatus vastuv\u00f5etud v\u00f5i tagasi l\u00fckatud p\u00e4ringutele teistelt marsruuteritelt, et luua marsruuti tunnel teie marsruuteri kaudu. Teie marsruuter v\u00f5ib aktsepteerida k\u00f5iki p\u00e4ringuid, aktsepteerida v\u00f5i tagasi l\u00fckata protsendi p\u00e4ringutest v\u00f5i tagasi l\u00fckata k\u00f5ik p\u00e4ringud mitmel p\u00f5hjusel, et kontrollida ribalaiuse ja CPU n\u00f5udmisi ning s\u00e4ilitada v\u00f5ime kohalike klientide jaoks. <b>M\u00e4rkus";
    t[2902] = "Please contact a known trustworthy friend who has a running I2P router, and ask them for help with reseeding your I2P router. Request that they send you a reseed file exported from their running I2P router. It is vital that the file is exchanged over a secure channel, e.g. encrypted to avoid external tampering (PGP Sign, Encrypt and Verified with a trusted public key). The file itself is unsigned, so please accept files only from known trusted friends. Never import a reseed file if you cannot verify its source.";
    t[2903] = "Paluge oma teadaolevalt usaldusv\u00e4\u00e4rsetelt s\u00f5pradelt abi I2P ruuteri taasistutamisel. Paluge neil saata teile reseedi fail, mille nad on eksporditud oma t\u00f6\u00f6tavast I2P ruuterist. On oluline, et faili vahetatakse turvalise kanali kaudu, n\u00e4iteks kr\u00fcpteeritud, et v\u00e4ltida v\u00e4ljastpoolt manipuleerimist (PGP allkirjastamine, kr\u00fcpteerimine ja kontrollimine usaldusv\u00e4\u00e4rse avaliku v\u00f5tmega). Fail ise on allkirjastamata, seega aktsepteerige faile ainult teadaolevatelt usaldusv\u00e4\u00e4rsetelt s\u00f5pradelt. Importige reseedi faili ainult siis, kui te ei saa selle p\u00e4ritolu kontrollida.";
    t[2916] = "Last Good Send";
    t[2917] = "Viimane edukas saatmine";
    t[2918] = "Delete this value to disable";
    t[2919] = "keelamiseks kustutage see v\u00e4\u00e4rtus";
    t[2920] = "You can use a recorder in one tunnel that writes to a file that another tunnel, or multiple tunnels, can use for throttling. These files can also be edited by hand.";
    t[2921] = "V\u00f5ite kasutada salvestajat \u00fches tunnelis, mis kirjutab faili, mida saab teine tunnel v\u00f5i mitu tunnelit kasutada piiramiseks. Neid faile saab ka k\u00e4sitsi muuta.";
    t[2924] = "Router running a non-native, software emulated version of the Java BigInteger library";
    t[2925] = "Ruuter, mis t\u00f6\u00f6tab Java BigInteger raamatukogu mitte-algst\u00fc\u00fcpsel, tarkvarap\u00f5hises emuleeritud versioonil";
    t[2928] = "Country";
    t[2929] = "Maa";
    t[2934] = "Peer's clockskew relative to our clock";
    t[2935] = "Eakaaslaste kellakaldumine meie kella suhtes";
    t[2936] = "A threshold that if breached will cause the offending remote destination to be recorded in a specified file";
    t[2937] = "T\u00f5ke, mille rikkumisel kantakse rikkunud kaugs\u00fcmnaik spetsifitseeritud faili";
    t[2938] = "This is usually due to a port 7654 conflict. Check the logs to verify.";
    t[2939] = "See juhtub t\u00f5en\u00e4oliselt pordi 7654 kasutamise konflikti t\u00f5ttu. Kontrolli logist.";
    t[2940] = "Disabling inbound TCP";
    t[2941] = "L\u00fclitan TCP \u00fchenduste vastuv\u00f5tu v\u00e4lja";
    t[2944] = "Keyring";
    t[2945] = "V\u00f5tmehoidja";
    t[2946] = "Verified family (signing certificate is installed and valid)";
    t[2947] = "Kinnitatud perekond (allkirjastamissertifikaat on installitud ja kehtiv)";
    t[2954] = "Router info not available";
