    t[3486] = "This is the number of peers your router has available for building client tunnels. It is generally in the range 8-30. Your fast peers are shown on the <a href='/profiles'>Profiles page</a>. <a href='/configstats#router.fastPeers'>[Enable graphing]</a>";
    t[3487] = "See on peeride arv, mille sinu ruuteril on saadaval klientide tunnelite loomiseks. See on tavaliselt vahemikus 8-30. Sinu kiired peerid on n\u00e4htaval <a href='/profiles'>Profiilide lehel</a>. <a href='/configstats#router.fastPeers'>[Luba graafiku kuvamine]</a>.";
    t[3488] = "Click the <i>Reseed from File</i> button";
    t[3489] = "Kl\u00f5psake nupul <i>Uuesti vaata failist</i>";
    t[3490] = "A variant of onion routing that encrypts multiple messages together to make it more difficult for attackers to perform traffic analysis and to increase the speed of data transfer. For more information, see the <a href=https://geti2p.net/en/docs/how/garlic-routing class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[3491] = "Sibularouting on siburarvutuse variant, mis kr\u00fcpteerib mitu teadet koos, et raskendada liiklusanal\u00fc\u00fcsi ning suurendada andmeedastuse kiirust. Rohkem teavet leiate <a href=https://geti2p.net/en/docs/how/garlic-routing class='sitelink external' target=_blank rel=noreferrer>vebdokumentatsioonist</a>.";
    t[3494] = "How to Harden Your WordPress Site";
    t[3495] = "Kuidas tugevdada oma WordPressi saiti";
    t[3496] = "I2P Internals";
    t[3497] = "I2P sisemus";
    t[3500] = "By default, I2P is supplied with a webserver to host your own anonymized website (traditionally referred to as an <i>eepsite</i>). Both the site and the I2P Router Console are running on a streamlined version of <a href='https://en.wikipedia.org/wiki/Jetty_(web_server)' target=_blank rel=noreferrer class='sitelink external'>Jetty</a>, customized for I2P.";
    t[3501] = "Vaikimisi on I2P-ga kaasas veebiserver, et majutada oma anon\u00fc\u00fcmset veebisaiti (tuntud ka kui <i>eepsite</i>). Nii sait kui ka I2P marsruuteri konsool t\u00f6\u00f6tavad <a href='https://en.wikipedia.org/wiki/Jetty_(web_server)' target=_blank rel=noreferrer class='sitelink external'>Jetty</a> kohandatud miniversioonil I2P jaoks.";
    t[3504] = "This setting allows you to exclude older routers from your NetDb. Routers older than the default or the value you set will be deleted from the NetDb and banned for the duration of the router session. By default, routers older than 0.9.20 are excluded. Note: starting with I2P+ version 0.9.46+, only routers running very recent versions are used for building local tunnels. [Restart required]";
    t[3505] = "Selle s\u00e4tte abil saate oma NetDb-st v\u00e4lja j\u00e4tta vanemad ruuterid. Vaikek\u00e4igust v\u00f5i m\u00e4\u00e4ratud v\u00e4\u00e4rtusest vanemad ruuterid kustutatakse NetDb-st ja keelatakse ruuteri t\u00f6\u00f6s oleku ajaks. Vaikimisi on v\u00e4lja j\u00e4etud ruuterid, mis on vanemad kui 0.9.20. M\u00e4rkus: alates I2P+ versioonist 0.9.46+ kasutatakse lokaalsete tunnelite loomiseks ainult hiljutisi versioone k\u00e4itavaid ruutereid. [Taask\u00e4ivitamine on vajalik]";
