    t[4625] = "<b>M\u00e4rkus:</b> M\u00f5nel Apache'i paigaldusel on vaikimisi lubatud <a href=https://httpd.apache.org/docs/2.4/mod/mod_status.html target=_blank class='sitelink external'>mod_status</a> ja <a href=https://httpd.apache.org/docs/2.4/mod/mod_info.html target=_blank class='sitelink external'>mod_info</a> moodulid. On oluline need keelata v\u00f5i kaitsta URL-e muul viisil, et v\u00e4ltida serveri anon\u00fc\u00fcmsuse ja turvalisuse ohustamist.";
