    t[4931] = "See seadistus, kui see on seadistatud kehtiva blocklist-faili teega, v\u00f5imaldab k\u00e4ivitamisel lisada veel \u00fche, kasutaja kohandatud blokeeringunimekirja. [Vaikimisi on keelatud, taask\u00e4ivitamine on vajalik]";
    t[4932] = "I2P+ supports custom theme overrides for the console, the tunnel manager, I2PSnark, SusiDNS and Susimail, permitting changes to the themes which are persistent after upgrades. In order to activate an override, create a css file named <code>override.css</code> with your theme modifications and place it in the relevant theme directory of the theme you wish to change, or rename one of the example files, and then hard refresh the browser. Note that the tunnel manager and the console share the same override.css. To deactivate an override, delete or rename the <code>override.css</code> file and then hard refresh the browser (usually Control + Shift + R).";
    t[4933] = "I2P+ toetab konsooli, tunneli halduri, I2PSnark, SusiDNSi ja Susimaili jaoks kohandatud teemade \u00fclekirjutusi, mis v\u00f5imaldavad teemade muutmist p\u00e4rast uuendusi j\u00e4\u00e4vaks. Selleks et \u00fclekirjutust aktiveerida, looge oma teemamuudatustega css-fail nimega <code>override.css</code> ja asetage see teema kausta, mida soovite muuta, v\u00f5i nimetage \u00fcmber \u00fcks n\u00e4idisfailidest ja seej\u00e4rel v\u00e4rskendage lehek\u00fclge. Tehelite haldur ja konsool jagavad sama override.css-faili. \u00dclekirjutuse deaktiveerimiseks kustutage v\u00f5i nimetage \u00fcmber <code>override.css</code> fail ja seej\u00e4rel v\u00e4rskendage lehek\u00fclge (tavaliselt kas kontroll + shift + R).";
