    t[5514] = "If after a few minutes of uptime your router is indicating 0 Active Peers and 0 Known Peers, with a notification in the sidebar that you need to check your network connection, verify that you can access the internet. If your internet connection is functional, you may need to unblock Java in your firewall. Otherwise, you may need to reseed your I2P router. Visit the <a href=/configreseed#reseedconfig>Reseed Configuration page</a> and click the <i>Save Changes and Reseed Now</i> button. For more information, see the <a href=#reseedhelp>Reseed help section</a> above.";
    t[5515] = "Kui m\u00f5ne minuti jooksul peale k\u00e4ivitamist teatab sinu marsuuter, et seal puuduvad aktiivsed v\u00f5i teatatud s\u00f5lmed ja k\u00fclgribas on m\u00e4rguanne, et pead kontrollima oma v\u00f5rgu\u00fchendust, kontrolli, kas saad ligip\u00e4\u00e4su internetile. Kui sinu interneti\u00fchendus on t\u00f6\u00f6korras, v\u00f5ib-olla pead Java avama oma tulem\u00fc\u00fcris. Vastasel korral v\u00f5ib-olla pead reseedima oma I2P marsuuteri. Minge <a href=/configreseed#reseedconfig>Reseedi seadete lehele</a> ja kl\u00f5psake nuppu <i>S\u00e4ilita muudatused ja reseedi n\u00fc\u00fcd</i>. Lisateabe saamiseks vaadake eespool olevat <a href=#reseedhelp>Reseedi abi osa</a>.";
    t[5518] = "A higher level socket API for clients. Only opened when a SAM V3 client requests a UDP session. Can be enabled/disabled on the <a href=/configclients> Client Configuration page</a>. Can be changed in the <code>clients.config</code> file with the SAM command line option <code>sam.udp.port=nnnn</code>.";
    t[5519] = "K\u00f5rgema taseme sokli API klientidele. Avatakse ainult siis, kui SAM V3 klient n\u00f5uab UDP seanssi. Saab lubada/keelata <a href=/configclients> kliendi konfiguratsiooni lehek\u00fcljelt</a>. Saab muuta failis <code>clients.config</code> SAM k\u00e4surea valikuga <code>sam.udp.port=nnnn</code>.";
    t[5526] = "If you want your site to feel responsive, image compression is essential when hosting large images. Using a service like <a href=https://tinypng.com/ target=_blank class='sitelink external'>tinypng.com</a> to compress your png and jpeg images will often result in much smaller files with minimal loss of quality. In some situations the webp format can best jpegs, generating smaller files with approximately the same or better visual fidelity, and has wide browser support. Also consider using svgs instead of bitmaps for icons and illustrations - they're often smaller than the equivalent bitmap file (run them through a service like <a href=https://vecta.io/nano target=_blank class='sitelink external'>Nano SVG Optimizer</a> to remove unneeded cruft), scale without loss of quality, and can be gzipped by your webserver.";
    t[5527] = "Kui soovite, et teie veebisait tunduks reageeriv, on oluline pakkida suuri pilte majutamisel. Teenuse nagu <a href=https://tinypng.com/ target=_blank class='sitelink external'>tinypng.com</a> kasutamine png- ja jpeg-piltide pakkimiseks toob sageli kaasa palju v\u00e4iksemad failid minimaalse kvaliteedikadumisega. M\u00f5nes olukorras v\u00f5ib webp-vorming olla parem kui jpeg-id, kuna genereerib v\u00e4iksemad failid umbkaudselt sama hea v\u00f5i parema visuaalse truudusega ning on laialdaselt brauseri toega. Kaaluge ka ikoonide ja illustratsioonide jaoks bitmapi asemel svg-de kasutamist - need on sageli v\u00e4iksemad kui ekvivalentne bitmapi fail (kasutage teenust nagu <a href=https://vecta.io/nano target=_blank class='sitelink external'>Nano SVG Optimizer</a> , et eemaldada tarbetu segadus), skaalanevad kvaliteedikadudeta ja neid saab teie veebiserver lehitsemiseks teisendada gzipiga.";
    t[5528] = "UPnP disabled on the device";
    t[5529] = "UPnP on seadmel v\u00e4lja l\u00fclitatud";
    t[5536] = "By default, most of your client services (mail, http proxy, IRC) will share the same set of tunnels (for performance reasons) and be listed as <i>Shared Clients</i> and <i>Shared Clients(DSA)</i> in the sidebar under Service Tunnels and on the <a href=/tunnels>Tunnels page</a>.";
    t[5537] = "Vaikimisi jagavad enamik teie klienditeenuseid (meil, HTTP puhverserver, IRC) sama tunnelikomplekti (j\u00f5udluse p\u00f5hjusel) ja on loetletud <i>Jagatud kliendid</i> ja <i>Jagatud kliendid (DSA)</i> k\u00fcljepaanil teenuse tunnelite all t\u00f6\u00f6koolis ja <a href=/tunnels>Tunnelilehel</a>.";
