    t[5712] = "Firewalled with Inbound TCP Enabled";
    t[5713] = "Tulem\u00fc\u00fcr, sissetulev TCP on lubatud";
    t[5716] = "Open <a href=/confignet#udpconfig>I2P+'s port</a> on your modem, router and/or firewall(s) for better connectivity (ideally both UDP and TCP). More information on how to go about port forwarding can be found at <a href=http://portforward.com/ target=_blank rel=noreferrer class='sitelink external'>portforward.com</a>, in addition to our forums and IRC channels listed below. Note that I2P does not support connecting to the internet via an http or socks proxy [patches welcome!], though you can connect to proxies via I2P itself once connected to the network.";
    t[5717] = "Parema \u00fchenduvuse tagamiseks avage port <a href=/confignet#udpconfig>I2P+'s port</a> oma modemis, ruuteris ja/v\u00f5i tulem\u00fc\u00fcris (ideaalis nii UDP kui TCP). Kuidas porti suunata, saate lisateavet <a href=http://portforward.com/ target=_blank rel=noreferrer class='sitelink external'>portforward.com</a> veebisaidilt ning oma foorumitest ja IRC-kanalitest allpool. Pange t\u00e4hele, et I2P ei toeta \u00fchendumist internetiga HTTP- v\u00f5i SOCKSi puhverserveri kaudu [m\u00f5tted teretulnud!], kuid saate p\u00e4rast v\u00f5rguga \u00fchenduse loomist I2P kaudu \u00fchendada proksi\u00fchenduste kaudu ise.";
    t[5730] = "A tunnel filter can provide protection against denial of service attacks, without otherwise interrupting the service for genuine users, either in conjunction with the tunnel throttler or as an alternative strategy. It can also be used to log access to a hosted service to determine if the server is under attack, or simply to log all visitors by I2P destination. Additionally, a filter can function simultaneously as a whitelist and blacklist making it more flexible than the Tunnel Manager's access list controls. Note that multiple server tunnels can share a single filter file if you wish to implement a global filter.";
    t[5731] = "Tunnelifilter saab pakkuda DDoS r\u00fcnnakute vastu kaitset, kahjustamata teenust ehtsatele kasutajatele, kas tunneli kiirusepiiraja abil v\u00f5i alternatiivse lahendusena. See v\u00f5ib samuti logida juurdep\u00e4\u00e4su majutatud teenusele, et tuvastada, kas server on r\u00fcnnaku all v\u00f5i lihtsalt k\u00f5ik k\u00fclastused I2P sihtkoha j\u00e4rgi. Lisaks saab filter samaaegselt tegutseda nii valgenimekirjana kui mustnimekirjana, tehes selle paindlikumaks kui Tunnelihalduri juurdep\u00e4\u00e4sulubade kontrollid. Pange t\u00e4hele, et kui soovite rakendada globaalset filterit, saavad mitu serveritunnelit jagada \u00fchte filterfaili.";
