    t[6026] = "This setting (in milliseconds) allows you to manually configure the delay between router refresh updates run by the Refresh Routers Job. By default the pause between refreshes is determined by the size of the NetDb, and introduces some randomness in the timing to mitigate traffic analysis. For values lower than 2000 milliseconds, increasing the value of <code>router.refreshTimeout</code> is recommended. Note that setting this value below 2000 milliseconds will increase your network traffic and may introduce job lag, and is not recommended for sustained use.";
    t[6027] = "See s\u00e4ttetus (millisekundites) v\u00f5imaldab sul seadistada, kui sageli hoitakse \u00fcleval v\u00e4rskenduste t\u00f6\u00f6\u00fclesannet. Vaikepaus v\u00e4rskenduste vahel s\u00f5ltub NetDb suurusest ning juhuslikest viivitustest liiklusanal\u00fc\u00fcsi v\u00e4hendamiseks. V\u00e4\u00e4rtuste korral, mis on v\u00e4iksemad kui 2000 millisekundit, soovitatakse suurendada router.refreshTimeout v\u00e4\u00e4rtust. Pange t\u00e4hele, et selle v\u00e4\u00e4rtuse seadistamine alla 2000 millisekundi suurendab v\u00f5rguliiklust ja v\u00f5ib p\u00f5hjustada t\u00f6\u00fclesannete mahaj\u00e4\u00e4mist ning ei ole pikaajaliseks kasutamiseks soovitatav.";
    t[6030] = "Server tunnels, configurable in the <a href=/i2ptunnelmgr>Tunnel Manager</a>, provide a number of ways to limit access to the hosted service. Destination whitelisting, blacklisting, connection throttling, and tunnel filtering are methods provisioned to mitigate denial of service attacks, grant exclusive access to known I2P destinations, and manage traffic to the server.";
    t[6031] = "Serveritunnelid, mida saab seadistada <a href=/i2ptunnelmgr>Tunnelihalduris</a>, pakuvad mitmeid viise juurdep\u00e4\u00e4su piiramiseks majutatud teenusele. Suunamise valge nimekirja loomine, musta nimekirja koostamine, \u00fchenduse kiiruse piiramise ning tunnelifiltrid on meetodid, mida kasutatakse tempistamisr\u00fcnnakute peatamiseks, eraldusv\u00e4\u00e4rtuse andmiseks teadaolevatele I2P sihtkohtadele ja liikluse haldamiseks serverisse.";
