    t[6214] = "Do not reveal this file to unknown users, as it contains sensitive data (100 RouterInfo files) from your own I2P router which potentially could be used by an adversary to decloak your identity. In order to protect your anonymity: you should wait for a few hours/days before sharing the file with your trusted friend. It is also advisable to use this procedure sparingly (no more than once a week).";
    t[6215] = "\u00c4rge paljastage seda faili v\u00f5\u00f5rastele kasutajatele, kuna see sisaldab tundlikke andmeid (100 RouterInfo faili) teie enda I2P ruuterist, mida vastane v\u00f5ib potentsiaalselt kasutada teie identiteedi avastamiseks. Anon\u00fc\u00fcmsuse kaitseks peaksite ootama m\u00f5ned tunnid/p\u00e4evad enne faili jagamist usaldusv\u00e4\u00e4rse s\u00f5braga. Samuti on soovitatav seda protseduuri kasutada m\u00f5\u00f5dukalt (mitte rohkem kui kord n\u00e4dalas).";
