    t[6377] = "Kui nihke suurus on rohkem kui m\u00f5ned sekundid, parandage probleem, kohandades oma arvuti kellaaega.";
    t[6382] = "Note: To enhance your security when browsing .i2p sites, you may wish to consider installing an addon to prevent Javascript from running in the browser such as <a href=https://addons.mozilla.org/en-US/firefox/addon/noscript/ target=_blank rel=noreferrer class='sitelink external'>NoScript</a>, though it's recommended to whitelist the address I2P+ is running on to enable various router console enhancements. In addition, an addon that prevents requests to offsite resources is also recommended, for example <a href=https://addons.mozilla.org/en-US/firefox/addon/umatrix/ target=_blank rel=noreferrer class='sitelink external'>uMatrix</a>.";
    t[6383] = "M\u00e4rkus: .i2p saitidel sirvides v\u00f5ite kaaluda turvalisuse suurendamiseks lisandmooduli installimist, mis takistab JavaScripti t\u00f6\u00f6tamist brauseris, n\u00e4iteks <a href=https://addons.mozilla.org/en-US/firefox/addon/noscript/ target=_blank rel=noreferrer class='sitelink external'>NoScript</a>, kuigi soovitatav on lisada I2P+ kasutatava aadressi valgesse nimekirja, et lubada erinevaid marsruuteri konsooli t\u00e4iendusi. Lisaks on soovitatav kasutada lisandmoodulit, mis takistab p\u00e4ringuid v\u00e4lisedele ressurssidele, n\u00e4iteks <a href=https://addons.mozilla.org/en-US/firefox/addon/umatrix/ target=_blank rel=noreferrer class='sitelink external'>uMatrix</a>.";
