    t[7166] = "The I2P Client Protocol (I2CP) enables external applications (clients) to communicate with I2P over single TCP socket, by default using port 7654. For more information, see the <a href=https://geti2p.net/en/docs/protocol/i2cp class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7167] = "I2P klientprotokoll (I2CP) v\u00f5imaldab v\u00e4listel rakendustel (klientidel) suhelda I2P-ga \u00fcle \u00fche TCP-pesa, vaikimisi kasutades porti 7654. Rohkem teavet leiate <a href=https://geti2p.net/en/docs/protocol/i2cp class='sitelink external' target=_blank rel=noreferrer>vebdokumentatsioonist</a>.";
    t[7168] = "Queue Totals";
    t[7169] = "J\u00e4rjekorra summad";
    t[7170] = "This setting determines which transport takes priority when communicating with peers. By default, NTCP is favored over UDP (SSU). By setting the value to true, UDP will be favored unless a pre-existing NTCP connection exists; when set to always, UDP will always be used regardless of any pre-existing NTCP connection. [Default is false]";
    t[7171] = "Selle seade m\u00e4\u00e4rab, milline \u00fchendusviis saab prioriteedi seosetute serveritega suhtlemisel. Vaikimisi eelistatakse NTCP-d UDP asemel (SSU). Kui seada v\u00e4\u00e4rtuseks true, eelistatakse UDP-d, v\u00e4lja arvatud juhul, kui juba on olemas NTCP-\u00fchendus; kui seada v\u00e4\u00e4rtuseks always, kasutatakse alati UDP-d, hoolimata olemasolevast NTCP-\u00fchendusest . [Vaikimisi on false]";
