    t[7292] = "When set to true, I2P runs without network connectivity, which is helpful if you are constantly restarting the router to test code updates as this prevents network disruption.";
    t[7293] = "Kui see seadistus on true, t\u00f6\u00f6tab I2P ilma v\u00f5rgu\u00fchenduseta, mis on kasulik, kui teiste marsruuterite kodeerimisuuenduste testimiseks tuleb marsruuterit pidevalt taask\u00e4ivitada ja see takistab v\u00f5rgu katkestusi.";
