    t[7309] = "Ainult IPv6 SSU, tutvustajad";
    t[7312] = "SSU (Secure Semi-reliable UDP) is an I2P network transport providing encrypted, connection-oriented, point-to-point connections, in addition to IP address detection and NAT traversal services. For more information, see the <a href=https://geti2p.net/en/docs/transport/ssu class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7313] = "SSU (Secure Semi-reliable UDP) on I2P v\u00f5rgu transport, mis pakub kr\u00fcptitud, \u00fchenduskeskseid, punktist punkti \u00fchendusi, lisaks IP-aadressi tuvastamis- ja NAT-i leevendusteenuseid. Lisateabe saamiseks vaadake <a href=https://geti2p.net/en/docs/transport/ssu class='sitelink external' target=_blank rel=noreferrer>veebidokumentatsiooni</a>.";
    t[7314] = "Congestion window";
    t[7315] = "ummikuaken";
    t[7326] = "Use Proxy to Reseed";
    t[7327] = "Kasutage uuesti k\u00fclvamiseks puhverserverit";
    t[7328] = "Until the advent of I2P integration in <a href=http://www.vuze.com/ target=_blank rel=noreferrer class='sitelink external'>Vuze</a>, it wasn't possible to download torrents that weren't hosted on the I2P network. However, now that Vuze (and latterly <a href=https://www.biglybt.com/ target=_blank rel=noreferrer class='sitelink external'>Bigly</a>) allow users to share non-I2P torrents on I2P, non-I2P torrents can be downloaded over I2P if Vuze/Bigly users have chosen to make content available to the I2P network. Popular torrents with a large number of peers are more likely to be accessible via I2P; to determine if the content is available, add the torrent link, magnet or infohash to your I2P-enabled BitTorrent client.";
    t[7329] = "Enne I2P integreerimist <a href=http://www.vuze.com/ target=_blank rel=noreferrer class='sitelink external'>Vuzes</a> ei olnud v\u00f5imalik allalaadida torrenteid, mis polnud majutatud I2P v\u00f5rgus. Kuid n\u00fc\u00fcdsest saab Vuze (ja hiljem ka <a href=https://www.biglybt.com/ target=_blank rel=noreferrer class='sitelink external'>Bigly</a>) lubada kasutajatel jagada mitte-I2P torrenteid I2P-s ning selliseid mitte-I2P torrenteid saaks I2P kaudu alla laadida, kui Vuze/Bigly kasutajad on otsustanud sisu I2P v\u00f5rgule k\u00e4ttesaadavaks teha. Populaarsed torrentid suure hulga v\u00f5rdsetega on suurema t\u00f5en\u00e4osusega I2P kaudu k\u00e4ttesaadavad; kui soovite teada saada, kas sisu on saadaval, lisage torrenti link, magnet v\u00f5i infohash oma I2P-v\u00f5imendiga BitTorrenti klienti. ";
