    t[7443] = "ruuteri abi ja KKK";
    t[7444] = "If a <i>Registration Authentication</i> string is requested, you can find it on the <a href='http://127.0.0.1:7657/i2ptunnel/register?tunnel=3'>Registration Authentication page</a> linked from the <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>. Registration authentication ensures only the owner is able to register or otherwise manage the hostname, and is required on stats.i2p and reg.i2p.";
    t[7445] = "Kui k\u00fcsitakse <i>Registreerimisautentimise</i> stringi, leiate selle <a href='http://127.0.0.1:7657/i2ptunnel/register?tunnel=3'>Registreerimisautentimise lehek\u00fcljelt</a>, mis on seotud <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Tunnelihalduri konfiguratsioonilehelt</a>. Registreerimisautentimine tagab, et ainult omanik saab registreerida v\u00f5i hallata hostinime ning seda n\u00f5utakse stats.i2p ja reg.i2p.";
    t[7448] = "News &amp; Updates";
    t[7449] = "Uudised ja v\u00e4rskendused";
    t[7452] = "[Linux/Unix/Solaris] If you can't start the router with <code>i2p/i2prouter start</code> try the <code>runplain.sh</code> script in the same directory. Root privileges are never required to run I2P+. If you need to compile the <a href=http://i2p-projekt.i2p/jbigi.html target=_blank rel=noreferrer>jBigi library</a> (which is necessary in rare cases), consult the documentation, visit the forums, or visit <a href=irc://127.0.0.1:6668/saltR class=chatlink>the I2P+ channel</a> or <a href=irc://127.0.0.1:6668/i2p-dev class=chatlink>IRC developer channel</a>.";
    t[7453] = "[Linux/Unix/Solaris] Kui te ei saa marsruuterit k\u00e4ivitada koos <code>i2p/i2prouter start</code> proovige sama kataloogis <code>runplain.sh</code> skripti. Juur\u00f5igusi pole kunagi vaja I2P+ k\u00e4ivitamiseks. Kui peate kompileerima <a href=http://i2p-projekt.i2p/jbigi.html target=_blank rel=noreferrer>jBigi teeki</a> (mis on vajalik harvadel juhtudel), konsulteerige dokumentatsiooniga, k\u00fclastage foorumeid v\u00f5i minge <a href=irc://127.0.0.1:6668/saltR class=chatlink>I2P+ kanalisse</a> v\u00f5i <a href=irc://127.0.0.1:6668/i2p-dev class=chatlink>IRC-i arenduskanalisse</a>.";
