    t[7459] = "Informatsioon, mis m\u00e4\u00e4ratleb unikaalse ruuteri identiteedi v\u00f5rgus, sealhulgas selle IP-aadressi (v\u00f5i vahepealsete tuvastajate IP-aadressid) ja kuulamisport, avalikud allkirjastamise ja kr\u00fcpteerimise v\u00f5tmed. Ruuteri identiteedid vastavad kaasruuteritele NetDB-s. Tuntud ka kui <i>Ruuteriinfo</i>.";
