    t[7808] = "UPnP may be enabled or disabled on the Network Configuration page, but a change requires a router restart to take effect.";
    t[7809] = "UPnP v\u00f5ib olla sisse l\u00fclitatud v\u00f5i v\u00e4lja l\u00fclitatud v\u00f5rgu konfiguratsiooni lehel, kuid muudatuse kehtimiseks on vaja ruuteri taask\u00e4ivitust.";
    t[7818] = "Defines the maximum number of parallel <a href=/jobs>jobs</a> that can be run. The default value is determined by the amount of memory allocated to the JVM via <code>wrapper.config</code>, and is set at 3 for less than 64MB, 4 for less than 256M, or 5 for more than 256MB. Note: A change to this setting requires a restart of the router.";
    t[7819] = "M\u00e4\u00e4rab maksimaalse paralleelsete <a href=/jobs>t\u00f6\u00f6de</a> arvu, mis saab t\u00f6\u00f6tada. Vaikenumber m\u00e4\u00e4ratakse JVM'le eraldatava m\u00e4lu koguse j\u00e4rgi <code>wrapper.config</code>, ja see on kas 3, kui m\u00e4lu on alla 64MB, 4, kui m\u00e4lu on alla 256M, v\u00f5i 5, kui m\u00e4lu on rohkem kui 256MB. M\u00e4rkus: selle seadistamise muutmisel tuleb ruuter taask\u00e4ivitada.";
