    t[8207] = "Algas";
    t[8208] = "Wherever possible, assets that are used repeatedly on your site should be loaded from an external file and not inlined. If you're using the same CSS on several pages, create a separate css file and load that in the <code>&lt;head&gt;</code> section of your pages. This will make styling updates to your site easier to manage, and will also allow the file to be cached in the visitor's browser, resulting in less bandwidth demands on your webserver and faster page loads for your visitors.";
    t[8209] = "Kus v\u00f5imalik, tuleks teie veebisaidil korduvalt kasutatavad ressursid laadida v\u00e4lisfailist ja mitte sisestada neid. Kui kasutate mitmel lehel sama CSS-i, looge eraldi css-fail ja laadige see oma lehek\u00fclgede <code>&lt;head&gt;</code> osasse. See muudab teie saidi kujunduse uuendamise lihtsamaks ja v\u00f5imaldab faili vahepealset. memory-taluvates brauserites, v\u00e4hemad teie veebiserveri ribalaiuse n\u00f5uded ja kiiremad lehe laadimised teie k\u00fclastajate jaoks.";
