    t[8256] = "Configuring I2P+: Network, Firefox, Tunnel Manager";
    t[8257] = "I2P+ seadistamine: v\u00f5rgustik, Firefox, tunnelihaldur";
    t[8258] = "If you think you have opened up your firewall and I2P still thinks you are firewalled, remember that you may have multiple firewalls, for example both software packages and external hardware routers.";
    t[8259] = "Kui sa arvad, et suunasid oma tulem\u00fc\u00fcrilt pordi I2P ruuterile, aga I2P arvab ikka, et oled tulem\u00fc\u00fcri taga, pea meeles et v\u00f5id olla ka mitme erineva tulem\u00fc\u00fcri taga, n\u00e4iteks tarkvaralise tulem\u00fc\u00fcri ja riistvaraliste ruuterite.";
    t[8270] = "The keyword <i class=example>deny</i>. This threshold is always breached, i.e. no connection attempts will be allowed.";
    t[8271] = "V\u00f5tmes\u00f5na <i class=example>deny</i>. See l\u00e4vend rikutakse alati, st ei lubata \u00fchtegi \u00fchenduse katsetust.";
    t[8282] = "log visitors making 90 or more connections a minute";
    t[8283] = "logige k\u00fclastajad, kes teevad 1 minuti jooksul 90 v\u00f5i enam \u00fchendust";
    t[8286] = "You have configured inbound TCP, however your UDP port is firewalled, and therefore it is likely that your TCP port is firewalled as well.";
    t[8287] = "Oled seadistanud \u00e4ra sisenevate TCP \u00fchenduste vastuv\u00f5tu, aga sinu UDP port on tulem\u00fc\u00fcri taga. Seet\u00f5ttu on t\u00f5en\u00e4oline, et sinu TCP port on samuti tulem\u00fc\u00fcri taga.";
    t[8296] = "This is the number of peers your router will use for network database inquiries. These are usually the <i>floodfill</i> routers which are responsible for maintaining network integrity. Your well integrated peers are shown on the bottom of the <a href='/profiles'>Profiles page</a>.";
    t[8297] = "See on ruuteri v\u00f5rguandmebaasi p\u00e4ringute jaoks kasutavate ruuterite arv. Need on tavaliselt vastutavad v\u00f5rgu tervikluse s\u00e4ilitamise eest. Teie h\u00e4sti integreeritud ruuterid kuvatakse <a href='/profiles'>Profiilide lehe</a> allosas.";
    t[8298] = "Manage Router webapps";
    t[8299] = "haldage ruuteri veebirakendusi";
    t[8302] = "Outbound TCP from random high ports to arbitrary remote TCP ports.";
    t[8303] = "V\u00e4ljuv TCP suvalistest k\u00f5rgetest portidest suvalistesse kaugsetesse TCP portidesse.";
    t[8310] = "When you start I2P, it may take a few minutes to bootstrap (integrate) your router into the network and find additional peers, so please be patient.";
    t[8311] = "Kui k\u00e4ivitate I2P, v\u00f5ib teie ruuteri v\u00f5rku alglaadimine (integreerimine) ja t\u00e4iendavate partnerite leidmine v\u00f5tta paar minutit, seega olge kannatlik.";
