    t[8410] = "To disable directory listings, find the entry for <code>org.eclipse.jetty.servlet.Default.dirAllowed</code> in the <code>base-context.xml</code> file, located in the <code>eepsite/contexts</code> folder (just above docroot folder), and change 'true' to 'false' immediately underneath. To apply the change immediately, stop and restart the <i>I2P Webserver</i> client on the <a href=/configclients>Client Configuration page</a>. You can also drop an empty <code>index.html</code> file in any exposed directory to suppress directory listings for that location.";
    t[8411] = "Kataloogide loendamise keelamiseks leidke kirje <code>org.eclipse.jetty.servlet.Default.dirAllowed</code> failis <code>base-context.xml</code>, mis asub kaustas <code>eepsite/contexts</code> (otse dokumendijuure kausta kohal), ja muutke 'true'i 'false'ks otse selle all. Muudatuse rakendamiseks kohe peatage ja k\u00e4ivitage <i>I2P veebiserveri</i> klient <a href=/configclients>Kliendiconfiguratsiooni lehel</a>. V\u00f5ite ka j\u00e4tta t\u00fchja <code>index.html</code> faili mis tahes n\u00e4htavasse kausta, et v\u00e4ltida kataloogide loendamist selles asukohas.";
