    t[8572] = "<a href=/logs>Logs</a> may help resolve a problem. You may wish to paste excerpts in a <a href=http://i2pforum.i2p/ target=_blank rel=noreferrer>forum</a> for help, or perhaps <a href=http://cake.i2p/pastebin/ target=_blank rel=noreferrer class='sitelink external'>paste</a> it instead and reference the link on IRC for help.";
    t[8573] = "<a href=/logs>Logid</a> v\u00f5ivad probleemi lahendada. Soovite v\u00f5ib-olla v\u00e4ljav\u00f5tteid kleepida <a href=http://i2pforum.i2p/ target=_blank rel=noreferrer>foorumisse</a> abi saamiseks v\u00f5i kleepida selle asemel <a href=http://cake.i2p/pastebin/ target=_blank rel=noreferrer class='sitelink external'>sisestage</a> seda ja viite linki IRC-s abi saamiseks.";
    t[8574] = "Plugins signed with the cryptographic key of the developer are the recommended format, but if you wish to install unsigned plugins (.zip) you can set this to true. Note that you may still encounter issues attempting to install an unsigned plugin if the developer has included additional checks in the plugin build process.";
    t[8575] = "Arendaja kr\u00fcptov\u00f5tmega allkirjastatud pistikprogrammid on soovitatav formaat, kuid kui soovite installida allkirjastamata pistikprogramme (.zip), saate selle seade m\u00e4\u00e4rata t\u00f5ev\u00e4\u00e4rtuseks. Pange t\u00e4hele, et kui arendaja on pistikprogrammi koostamisprotsessi lisatud t\u00e4iendavad kontrollid, v\u00f5ib teil siiski tekkida probleeme, kui proovite installida allkirjastamata pistikprogrammi.";
    t[8578] = "If you are running a standalone Tor instance locally, you may use it by configuring I2P to use: <i>Proxy type:</i> <code>SOCKS 5</code> <i>Host:</i> <code>127.0.0.1</code> <i>Port:</i> <code>9050</code>.";
    t[8579] = "Kui k\u00e4itate kohalikult iseseisvat Tori eksemplari, saate seda kasutada I2P konfigureerides: <i>Proksi t\u00fc\u00fcp:</i> <code>SOCKS 5</code> <i>Host:</i> <code>127.0.0.1</code> <i>Port:</i> <code>9050</code>.";
    t[8584] = "Select the language to be used for the router console and web applications (<a href=/webmail target=_blank rel=noreferrer>webmail</a>, <a href=/torrents target=_blank rel=noreferrer>torrents</a>, <a href=/i2ptunnelmgr target=_blank rel=noreferrer>tunnel manager</a> etc). If you wish to change the language in future, change the router console theme, or configure a password to access the console, you may do so on the <a href=/configui target=_blank rel=noreferrer>User Interface configuration page</a>.";
    t[8585] = "Valige ruuteri konsooli ja veebirakenduste (nt. <a href=/webmail target=_blank rel=noreferrer>veebipost</a>, <a href=/torrents target=_blank rel=noreferrer>torrentid</a>, <a href=/i2ptunnelmgr target=_blank rel=noreferrer>tunneli haldur</a> jne) kasutamise keel. Kui soovite tulevikus keelt muuta, muuta ruuteri konsooli teemat v\u00f5i seadistada juurdep\u00e4\u00e4su parool, saate seda teha <a href=/configui target=_blank rel=noreferrer>Kasutajaliidese seadete lehel</a>.";
