    t[9240] = "A simple CGI application that takes a hostname as a parameter and returns a 301 redirect to the proper URL with a <code>?i2paddresshelper=key</code> string appended. The HTTP proxy will interpret the appended string and use the key as the actual destination. In addition, the proxy will cache the key so the address helper is not necessary until restart, and offer the option to add the resolved address to the addressbook.";
    t[9241] = "Lihtne CGI rakendus, mis v\u00f5tab parameetrina vastu hostinime ja suunab selle 301 \u00fcmbersuunamise abil sobivale URL-ile, millele on lisatud <code>?i2paddresshelper=key</code> string. HTTP proksis t\u00f5lgendatakse lisatud stringi ja kasutatakse seda v\u00f5rgusihina. Lisaks vahem\u00e4luvad proksid v\u00f5rgusihina lisatud stringi nii, et aadressitoetajat pole uuesti vaja enne taask\u00e4ivitamist. Lisaks pakuvad proksid v\u00f5imalust lisada lahendatud aadress aadressiraamatusse.";
