    t[9354] = "Reseeding is the bootstrapping process used to find other routers when you first install I2P, or when your router has too few router references remaining. The default settings will work for most people. Change these only if HTTPS is blocked by a restrictive firewall and reseed has failed.";
    t[9355] = "Uuestis\u00e4ttimine on protsess, mida kasutatakse I2P-s teiste ruuterite leidmiseks esmakordse installimise korral v\u00f5i kui teie ruuteris on j\u00e4\u00e4nud liiga v\u00e4he ruuteri viiteid. Vaikev\u00e4\u00e4rtused t\u00f6\u00f6tavad enamus inimeste jaoks. Muutke neid ainult juhul, kui HTTPS on piirava tulem\u00fc\u00fcri poolt blokeeritud ja uuestis\u00e4ttimine eba\u00f5nnestus.";
    t[9362] = "This setting, when enabled, modifies the maximum additional random pong delay introduced for ping-enabled servers, if <code>i2p.streaming.enablePongDelay</code> is also enabled. Unless explicitly set, the default value of 50ms will be used.";
    t[9363] = "Kui see seadistus on sisse l\u00fclitatud, muudetakse pingiga \u00fchenduse aktsepteerivatele serveritele lisatava maksimaalse t\u00e4iendava juhusliku pongi viivituse v\u00e4\u00e4rtust, kui on ka lubatud <code>i2p.streaming.enablePongDelay</code>. Kui seda eraldi m\u00e4\u00e4ratletud ei ole, kasutatakse vaikev\u00e4\u00e4rtust 50 ms.";
