    t[9466] = "This may be a transient error, if the other program is no longer using the port.";
    t[9467] = "See v\u00f5ib olla m\u00f6\u00f6duva loomuga viga, kui teine programm pordi vabastab.";
    t[9474] = "Your I2P+ router by default contributes to the network by routing internal, end-to-end encrypted traffic for other routers, known as <i>participation</i>. Bandwidth participation improves the anonymity level of all users on the network and maximizes your download speed.";
    t[9475] = "Teie I2P+ ruuter aitab vaikimisi v\u00f5rgus kaasa suunates teistele ruuteritele sisemist l\u00f5puni kr\u00fcptitud liiklust - <i>osalemist</i>. L\u00e4bilaske v\u00f5imekusega osalemine parandab v\u00f5rgus k\u00f5ikide kasutajate anon\u00fc\u00fcmsusastet ja maksimeerib allalaadimiskiirust.";
    t[9476] = "This setting permits the configuration of alternative NTP servers required to ensure that your router maintains accurate clock time. [Default is 0.pool.ntp.org,1.pool.ntp.org,2.pool.ntp.org]";
    t[9477] = "See seadistus v\u00f5imaldab alternatiivsete NTP serverite seadistamist, mis on vajalikud selleks, et teie marsruuter hoiaks t\u00e4pset kellaega. [Vaikimisi on 0.pool.ntp.org,1.pool.ntp.org,2.pool.ntp.org]";
    t[9484] = "Optimize your images";
    t[9485] = "Optimeerige oma pilte";
    t[9488] = "Note that the profiler relies on sustained client tunnel usage to accurately profile peers.";
    t[9489] = "Pange t\u00e4hele, et profiili koostaja tugineb partnerite t\u00e4pseks profiilimiseks pidevale klienditunneli kasutamisele.";
    t[9492] = "If you are in a hurry and can't wait a few hours, you can tell people to use a \"jump\" address helper redirection service. This will usually work within a few minutes of your registering your hostname on the same site. Test it yourself first by entering <code>http://stats.i2p/cgi-bin/jump.cgi?a=<i>yourchosenhostname.i2p</i></code> into your browser. Once it is working, you can tell others to use it.";
    t[9493] = "Kui olete kiirustanud ja ei saa m\u00f5nda tundi oodata, v\u00f5ite inimestele \u00f6elda, et nad saavad kasutada \"jump\" aadressiabistavaid \u00fcmbersuunamisteenuseid. Seda tavaliselt t\u00f6\u00f6tavad juba m\u00f5ne minuti p\u00e4rast p\u00e4rast teie domeeni registreerimist samal saidil. Testige seda k\u00f5igepealt ise, sisestades oma veebibrauserisse <code>http://stats.i2p/cgi-bin/jump.cgi?a=<i>yourchosenhostname.i2p</i></code>. Kui see t\u00f6\u00f6tab, v\u00f5ite \u00f6elda teistele seda kasutada.";
