    t[9621] = "Tuntud kiired ruuterid";
    t[9630] = "Tunnels built by other routers through your router. This may vary widely depending on network demand, your shared bandwidth, and amount of locally-generated traffic. The recommended method for limiting participating tunnels is to change your share percentage on the <a  href='/config'>Bandwidth Configuration page</a>. You may also limit the total number by setting <code>router.maxParticipatingTunnels=nnn</code> on the <a href='/configadvanced'>Advanced configuration page</a>. <a href='/configstats#tunnel.participatingTunnels'>[Enable graphing]</a>.";
    t[9631] = "Tunnelid, mis ehitatakse teiste marsruuterite poolt teie marsruuteri kaudu. See v\u00f5ib palju varieeruda, olenevalt v\u00f5rgu n\u00f5udlusest, teie jagatavast ribalaiusest ja kohapealsest liiklusest. Soovitatav meetod osalevate tunnelite piiramiseks on muuta oma osakaalu protsent lehele <a href='/config'>Ribakonfiguratsioon</a>. Teil on v\u00f5imalik piirata ka koguarvu, m\u00e4\u00e4rates <code>router.maxParticipatingTunnels=nnn</code> lehel <a href='/configadvanced'>T\u00e4psem konfiguratsioonileht</a>. <a href='/configstats#tunnel.participatingTunnels'>[Graafiku lubamiseks]</a>.";
