    t[10046] = "An I2P router usually only needs to be seeded once, to join the network for the first time. However, if the router is running for an extended period without network connectivity it may also need to be reseeded. Reseeding involves fetching multiple \"RouterInfo\" files (bundled into a signed zip-file) from at least two predefined server URLs picked from a volunteer-run group of clearnet HTTPS servers.";
    t[10047] = "I2P ruuter vajab tavaliselt \u00fche korra uuestis\u00f6\u00f6tmist, et v\u00f5rguga esimest korda \u00fchineda. Siiski, kui ruuter t\u00f6\u00f6tab pikema aja jooksul ilma v\u00f5rgu\u00fchenduseta, v\u00f5ib see vajada ka uuestis\u00f6\u00f6tmist. Uuestis\u00f6\u00f6t h\u00f5lmab mitme \u201eRouterInfo\u201c faili (moodustatud allkirjastatud zip-failiks) toomist v\u00e4hemalt kahest eelsalvestatud serveri URL-ist, mis on v\u00f5etud vabatahtlike poolt t\u00f6\u00f6datavatest clearnet HTTPS serveritest.";
