    t[11024] = "By default, I2P will use the system configured default browser to launch at startup. If you wish to nominate an alternative browser, you will need to edit your router.config file (or the <a href=/configadvanced>Advanced Configuration page</a> if you have enabled advanced console mode) and add a new configuration line <code>routerconsole.browser=/path/to/browser</code> or <code>routerconsole.browser=\\path\\to\\browser.exe</code> if using Windows, replacing <code>\\path\\to\\browser</code> with the location of the browser you wish to use. Note: If the path to your chosen browser contains spaces, you may need to encase the path in quotes e.g. <code>routerconsole.browser=\"C:\\Program Files\\Mozilla\\Firefox.exe\"</code>";
    t[11025] = "Vaikimisi kasutab I2P s\u00fcsteemiga seadistatud vaikimisi brauserit, et k\u00e4ivitada k\u00e4ivitamisel. Kui soovite nimetada alternatiivse brauseri, peate redigeerima oma router.config faili (v\u00f5i <a href=/configadvanced> T\u00e4psem seadistusleht </a>, kui olete lubanud edasij\u00f5udnud konsooli re\u017eiimi) ja lisage uus konfiguratsioonirea <code>routerconsole.browser=/lugemisava/to/browser</code> v\u00f5i <code>routerconsole.browser=\\lugemisava\\k\u00e4ivitusfaili\\lugemisava.exe</code>, kui kasutate Windowsit, asendades <code>\\lugemisava\\to\\brauser</code> brauseriga, mida soovite kasutada. M\u00e4rkus. Kui valitud brauseri tee sisaldab t\u00fchikuid, v\u00f5ib osutuda vajalikuks teekaane sisestada jutum\u00e4rkidesse, nt <code>routerconsole.browser=\"C:\\Program Files\\Mozilla\\Firefox.exe\"</code>";
