    t[11658] = "Your modem or router may support <a href=https://wikipedia.org/wiki/Universal_Plug_and_Play target=_blank rel=noreferrer>Universal Plug &amp; Play</a> (UPnP), which permits automatic port forwarding. Ensure UPnP support for I2P+ is enabled on the <a href=/confignet>config page</a>, then try to activate UPnP on your modem/router and possibly your computer also. Now try restarting the <a href=/>I2P+ router</a>. If successful, I2P+ should report \"Status: OK\" in the side panel once the I2P+ router completes initial connectivity tests.";
    t[11659] = "Lubage Universal Plug and Play (UPnP): modem v\u00f5i ruuter toetab enamasti <a href=https://wikipedia.org/wiki/Universal_Plug_and_Play target=_blank rel=noreferrer>Universal Plug &amp; Play</a>-i (UPnP) ehk universaalset plug-and-playd, mis v\u00f5imaldab automaatset pordi edastamist. Veenduge, et UPnP tugi oleks lubatud I2P+ seadistuslehel <a href=/confignet>config page</a> ja proovige seej\u00e4rel lubada UPnP oma modemis/ruuteris ning v\u00f5imalusel ka arvutis. Proovige seej\u00e4rel I2P+ marsruuter taask\u00e4ivitada. Eduka \u00fchenduse korral peaks I2P+ teavitama k\u00fcljepaneelis oleku \u201eok\u201c p\u00e4rast I2P+ marsruuteri l\u00e4biviidud algse \u00fchenduse kontrollimist.";
