    t[12026] = "I2P FAQ";
    t[12027] = "I2P FAQ";
    t[12028] = "If you hover over the <i>Router Info</i> heading, your truncated router identity will be shown (the first four characters (24 bits) of your 44-character (256-bit) Base64 router hash). The full hash is shown on your <a href='netdb?r=.'>Network Database entry</a>. Never reveal this to anyone, as your router identity is uniquely linked to your IP address in the network database.";
    t[12029] = "Kui h\u00f5ljutate kursoriga <i>Router Info</i> pealkirja kohal, n\u00e4idatakse teie l\u00fchendatud ruuteri identiteeti (teie 44-t\u00e4helise (256-bitise) Base64 ruuteri r\u00e4si esimesed neli t\u00e4hem\u00e4rki (24 bitti)). T\u00e4ielik r\u00e4si on n\u00e4idatud teie <a href='netdb?r=.'>v\u00f5rguandmebaasi kirjes</a>. \u00c4rge paljastage seda mitte kellelegi, kuna teie ruuteri identiteet on ainulaadselt seotud teie IP-aadressiga v\u00f5rguandmebaasis.";
    t[12030] = "Previous";
