    t[12033] = "ruuter on peatatud";
    t[12038] = "Directory listings (sometimes referred to as virtual directories) are enabled by default, so you can host files from a sub-directory of <code>docroot</code> without providing a page with links to the files. You can also serve content that exists outside of <code>docroot</code> by using a <a href=https://en.wikipedia.org/wiki/Symbolic_link target=_blank rel=noreferrer class='sitelink external'>symbolic link</a> to the desired directory.";
    t[12039] = "Kataloogi loendused (mida m\u00f5nikord nimetatakse virtuaalkataloogideks) on vaikimisi lubatud, nii et saate majutada failidest alamkataloogi <code>docroot</code> ilma, et peaksite sisaldama lehte, mis sisaldab lingid failidele. Saate ka teenindada sisu, mis asub v\u00e4ljaspool <code>docroot</code>, kasutades soovitud kataloogi jaoks <a href=https://en.wikipedia.org/wiki/Symbolic_link target=_blank rel=noreferrer class='sitelink external'>s\u00fcmbolilinki</a>.";
