    t[12199] = "Hostinime registreerimine";
    t[12200] = "If the number of known peers drops below 50, I2P will attempt to reseed automatically. If the reseed attempt fails, a notification will appear in the sidebar with an option to manually reseed. A failed reseed attempt can occur if your local firewall limits outbound traffic, you are experiencing network connectivity issues, or if the reseed request is blocked entirely.";
    t[12201] = "Kui teadaolevate eendite arv langeb alla 50, \u00fcritab I2P automaatselt uuesti s\u00f6\u00f6ta. Kui uuesti s\u00f6\u00f6tmise katse nurjub, ilmub k\u00fcljepaanil teade koos v\u00f5imalusega uuesti s\u00f6\u00f6ta k\u00e4sitsi. Nurjunud uuesti s\u00f6\u00f6tmise katse v\u00f5ib juhtuda, kui teie kohalik tulem\u00fc\u00fcr piirab v\u00e4ljaminevat liiklust, teil on v\u00f5rgu\u00fchenduse probleeme v\u00f5i kui uuesti s\u00f6\u00f6tamise taotlus on t\u00e4ielikult blokeeritud.";
    t[12202] = "Alternative privacy-focused front-end for Reddit";
    t[12203] = "Redditi alternatiivne privaatsusele keskendunud kasutajaliides";
    t[12224] = "Toggle Tunnels";
    t[12225] = "L\u00e4bi- ja v\u00e4ljutunneleid";
    t[12228] = "Can be disabled in the <code>clients.config</code> file. Can also be configured to bind to a specific interface or all interfaces in the <code>jetty.xml</code> file.";
    t[12229] = "Saab keelata failis <code>clients.config</code>. Saab seadistada siduma konkreetse liidese v\u00f5i k\u00f5igi liidestega failis <code>jetty.xml</code>.";
    t[12230] = "You can determine which services automatically start when the router starts, manage tunnel allocation to optimize for high usage services or to minimize the the cpu and memory overhead, add server and client tunnels to host or access services on the network, set rate limiting or tunnel filtering for your server tunnels and more.";
    t[12231] = "Saate m\u00e4\u00e4rata, millised teenused k\u00e4ivituvad automaatselt, kui ruuter k\u00e4ivitub, hallata tunneli eraldamist, et optimeerida k\u00f5rgel kasutusel olevate teenuste jaoks v\u00f5i minimeerida protsessori ja m\u00e4lu \u00fclekulu, lisada serveri- ja klienditunnelid v\u00f5rgus hostimiseks v\u00f5i teenustele juurdep\u00e4\u00e4suks, seada kiiruse piiramist v\u00f5i tunnelifiltrit serveritunnelitele ja palju muud.";
    t[12232] = "Binds to the LAN address. Can be changed with advanced config <code>i2np.upnp.HTTPPort=nnnn</code>. Can be disabled on the <a href=/confignet>Network Configuration page</a>.";
    t[12233] = "Seob LAN-aadressi k\u00fclge. Saab muuta t\u00e4pse konfiguratsiooniga <code>i2np.upnp.HTTPPort=nnnn</code>. Saab keelata <a href=/confignet>V\u00f5rgu konfiguratsiooni lehelt</a>.";
    t[12234] = "Data transferred";
    t[12235] = "Andmed edastatud";
    t[12244] = "In the box marked <i>No Proxy for</i> add the line <code>127.0.0.1,localhost</code> to ensure the I2P console and other locally hosted websites are still available.";
    t[12245] = "M\u00e4rkige kasti <i>No Proxy for</i> rida <code>127.0.0.1,localhost</code>, et tagada I2P konsooli ja muude kohapeal majutatud veebisaitide k\u00e4ttesaadavus.";
